// import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
// import Navbar from "../../Navbar/Navbar";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";
import * as React from "react";
import PropTypes from "prop-types";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import CssBaseline from "@mui/material/CssBaseline";
import useScrollTrigger from "@mui/material/useScrollTrigger";
import Container from "@mui/material/Container";
import Fab from "@mui/material/Fab";
import KeyboardArrowUpIcon from "@mui/icons-material/KeyboardArrowUp";
import Zoom from "@mui/material/Zoom";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';

import "./Home.css";

import headerImg from "../../../img/header-img.png";
import headerLogo from "../../../img/header-logo.png";
import logo from "../../../img/logo.png";

export default function Home() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <>
      <React.Fragment>
        <CssBaseline />
        <AppBar sx={{ backgroundColor: "#00468B" }}>
          <Toolbar>
            <Typography variant="h6" component="div">
              <img
                src={logo}
                alt=""
                width="10%"
                style={{ margin: "10px 0px 10px 0px" }}
              />
              <Tabs
                value={value}
                onChange={handleChange}
                aria-label="nav tabs example"
                left
              >
                <LinkTab label="Page One" href="/drafts" />
                <LinkTab label="Page Two" href="/trash" />
                <LinkTab label="Page Three" href="/spam" />
              </Tabs>
            </Typography>
          </Toolbar>
        </AppBar>
        <Toolbar id="back-to-top-anchor" />
        <Grid container spacing={2} sx={{ marginTop: "100px" }}>
          <Grid xs={6}>
            <img src={headerLogo} alt="" className="header-logo"></img>
            <h3 className="header-h3">
              Quickly and Easily Discover Developers Like You, Connect With Your
              Ideal Teammates and Coding Better Together.
            </h3>
            <Button
              type="submit"
              variant="contained"
              underline="none"
              sx={{
                ":hover": {
                  bgcolor: "#e4a300",
                },
                mt: 3,
                mb: 2,
                backgroundColor: "#FFB703",
                marginLeft: "200px",
              }}
            >
              <Link
                to="/signup"
                style={{ color: "white", textDecoration: "none" }}
              >
                Sign up
              </Link>
            </Button>
            <Button
              type="submit"
              variant="contained"
              sx={{
                mt: 3,
                mb: 2,
                marginLeft: "15px",
                backgroundColor: "#00468B",
                ":hover": {
                  bgcolor: "#00366b",
                },
              }}
              onClick={() => {}}
            >
              What is Devteams
            </Button>
            <p className="header-p">
              Already a member?
              <Link to="/signin" className="header-link">
                Log in here
              </Link>
            </p>
          </Grid>

          <Grid xs={6}>
            <img src={headerImg} alt="" className="header-img"></img>
          </Grid>
        </Grid>

        <Grid container spacing={2} sx={{ marginTop: "100px" }}></Grid>

        <ScrollTop>
          <Fab color="#00468B" size="small" aria-label="scroll back to top">
            <KeyboardArrowUpIcon />
          </Fab>
        </ScrollTop>
      </React.Fragment>
    </>
  );
}

function ScrollTop(props) {
  const { children, window } = props;
  const trigger = useScrollTrigger({
    target: window ? window() : undefined,
    disableHysteresis: true,
    threshold: 100,
  });
  const handleClick = (event) => {
    const anchor = (event.target.ownerDocument || document).querySelector(
      "#back-to-top-anchor"
    );
    if (anchor) {
      anchor.scrollIntoView({
        behavior: "smooth",
        block: "center",
      });
    }
  };

  return (
    <Zoom in={trigger}>
      <Box
        onClick={handleClick}
        role="presentation"
        sx={{ position: "fixed", bottom: 16, right: 16 }}
      >
        {children}
      </Box>
    </Zoom>
  );
}

ScrollTop.propTypes = {
  children: PropTypes.element.isRequired,

  window: PropTypes.func,
};

function LinkTab(props) {
  return (
    <Tab
      component="a"
      onClick={(event) => {
        event.preventDefault();
      }}
      {...props}
    />
  );
}
